import React from 'react';
import { motion } from 'framer-motion';
import { 
  PhoneIcon,
  EnvelopeIcon,
  MapPinIcon,
  HeartIcon
} from '@heroicons/react/24/outline';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const footerLinks = {
    hotel: [
      { name: 'Despre Noi', href: '#about' },
      { name: 'Camerele Noastre', href: '#rooms' },
      { name: 'Facilități', href: '#amenities' },
      { name: 'Galerie', href: '#gallery' },
      { name: 'Contact', href: '#contact' }
    ],
    servicii: [
      { name: 'Rezervări Online', href: '#' },
      { name: 'Spa & Wellness', href: '#' },
      { name: 'Restaurant', href: '#' },
      { name: 'Evenimente', href: '#' },
      { name: 'Transfer Aeroport', href: '#' }
    ],
    suport: [
      { name: 'FAQ', href: '#' },
      { name: 'Politica de Confidențialitate', href: '#' },
      { name: 'Termeni și Condiții', href: '#' },
      { name: 'Politica de Anulare', href: '#' },
      { name: 'Ajutor', href: '#' }
    ]
  };

  const socialLinks = [
    { name: 'Facebook', href: '#', icon: '📘' },
    { name: 'Instagram', href: '#', icon: '📷' },
    { name: 'TripAdvisor', href: '#', icon: '⭐' },
    { name: 'Booking.com', href: '#', icon: '🏨' }
  ];

  const scrollToSection = (href) => {
    const element = document.querySelector(href);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <footer className="bg-gray-900 text-white">
      {/* Main Footer */}
      <div className="container-custom py-16">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
          {/* Hotel Info */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
            className="lg:col-span-1"
          >
            <div className="flex items-center space-x-2 mb-6">
              <div className="w-8 h-8 bg-primary-600 flex items-center justify-center">
                <span className="text-white font-bold text-lg">M</span>
              </div>
              <span className="font-display font-bold text-xl">Hotel Marami</span>
            </div>

            <p className="text-gray-300 mb-6 leading-relaxed">
              Descoperă luxul și confortul în inima munților. O experiență memorabilă 
              așteaptă la fiecare colț al hotelului nostru din Sinaia.
            </p>

            {/* Contact Info */}
            <div className="space-y-3">
              <div className="flex items-center space-x-3">
                <PhoneIcon className="w-5 h-5 text-primary-400" />
                <span className="text-gray-300">+40 244 123 456</span>
              </div>
              <div className="flex items-center space-x-3">
                <EnvelopeIcon className="w-5 h-5 text-primary-400" />
                <span className="text-gray-300">info@hotelmarami.ro</span>
              </div>
              <div className="flex items-center space-x-3">
                <MapPinIcon className="w-5 h-5 text-primary-400" />
                <span className="text-gray-300">Sinaia, România</span>
              </div>
            </div>
          </motion.div>

          {/* Hotel Links */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.1 }}
          >
            <h3 className="font-display font-semibold text-lg mb-6">Hotel</h3>
            <ul className="space-y-3">
              {footerLinks.hotel.map((link, index) => (
                <li key={index}>
                  <button
                    onClick={() => scrollToSection(link.href)}
                    className="text-gray-300 hover:text-primary-400 transition-colors duration-200"
                  >
                    {link.name}
                  </button>
                </li>
              ))}
            </ul>
          </motion.div>

          {/* Services Links */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            <h3 className="font-display font-semibold text-lg mb-6">Servicii</h3>
            <ul className="space-y-3">
              {footerLinks.servicii.map((link, index) => (
                <li key={index}>
                  <a
                    href={link.href}
                    className="text-gray-300 hover:text-primary-400 transition-colors duration-200"
                  >
                    {link.name}
                  </a>
                </li>
              ))}
            </ul>
          </motion.div>

          {/* Support Links */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.3 }}
          >
            <h3 className="font-display font-semibold text-lg mb-6">Suport</h3>
            <ul className="space-y-3">
              {footerLinks.suport.map((link, index) => (
                <li key={index}>
                  <a
                    href={link.href}
                    className="text-gray-300 hover:text-primary-400 transition-colors duration-200"
                  >
                    {link.name}
                  </a>
                </li>
              ))}
            </ul>
          </motion.div>
        </div>

        {/* Newsletter & Social */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, delay: 0.4 }}
          className="mt-12 pt-8 border-t border-gray-800"
        >
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 items-center">
            {/* Newsletter */}
            <div>
              <h3 className="font-display font-semibold text-lg mb-4">
                Newsletter
              </h3>
              <p className="text-gray-300 mb-4">
                Abonează-te pentru oferte exclusive și noutăți despre hotelul nostru.
              </p>
              <div className="flex space-x-2">
                <input
                  type="email"
                  placeholder="Email-ul tău"
